import React from 'react';
import { useNavigate } from 'react-router-dom';
import foodBackground from '../assets/food_background.jpeg';

const Home = () => {

    const navigate = useNavigate();

    const menuClick = (e) => {
        e.preventDefault();
        navigate('menu');
    };

    const cartClick = (e) => {
        e.preventDefault();
        navigate('cart');
    };

    return (
    <div
        style={{
            position: "relative"
        }}>
        <img 
            alt="restauraunt food" 
            src={foodBackground}
            style={{
                width: "100%"
            }}
        />
        <h3 
            style={{
                position: "absolute",
                top: "10px",
                left: "50%",
                color: "white",
                transform: "translate(-50%, -50%)"
            }}
        >
            Mighty Mo's</h3>
    </div>
  );
}

export default Home;
